import React from 'react'
import "./UnitsCosts.css"

export default function UnitsCosts(props) {
    const handleChange = ev => {
        const target = ev.target
        const value = Number(target.value)
        props.onChangeFilter(target.id, value)
    }

    return (
        <div style={{ marginBottom: '50px', marginTop: '50px' }} onChange={handleChange}>
            <input type="range" id='Wood' min={0} max={200}></input>
            <label htmlFor="Wood">Wood</label>
            <input type="range" id='Food' min={0} max={200}></input>
            <label htmlFor="Food">Food</label>
            <input type="range" id='Gold' min={0} max={200}></input>
            <label htmlFor="Gold">Gold</label>
        </div>
    )
}
